{
  "aggs": {
    "AGGR": {
      "filters": {
        "filters": {
          "Campaign Filter":{
            "bool": {
              "must" : [
                {
                  "term": {
                    "targetType": "INDIVIDUAL"
                  }
                },
                {
                  "term": {
                    "productVariant": "LLIN"
                  }
                }
                ]
            }
          }
        }
        },
      "aggs": {
        "Target per day": {
          "sum": {
            "field": "targetPerDay"
          }
        },
        "Target Population per Day": {
          "bucket_script": {
            "buckets_path": {
              "tpd": "Target per day"
            },
            "script": "(params.tpd) * 365"
          }
        }
      }
      }
    }
  }

{
